import React from 'react';
import { AppBar, Toolbar, Typography ,Box, Tabs, Tab} from '@mui/material';
const Header = () => {
  return (
    <div>
      <AppBar>
        <Toolbar>
            <Typography variant='h3'>MernAuth</Typography>
            <Box>
                <Tabs>
                    
                </Tabs>
            </Box>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default Header;
